delete from  stkinfo where stkid in('300555','072004','002802','002004');
delete from QUOTAORDER where acctid='000011760501' and stkid in('300555','072004','002802');
update quotaorder  a  set  a.occurtime=(select    substr(b.tradedate,0,8)||substr(a.occurtime,9,14)       from sysconfig b );
update quotaorder  a  set  a.offertime=(select    substr(b.tradedate,0,8)||substr(a.offertime,9,14)       from sysconfig b );
update  quotaorder  a  set  a.ordertime=(select    substr(b.tradedate,0,8)||substr(a.ordertime,9,14)       from sysconfig b );
